import { useEffect } from "react";
import { useNavigate, useLocation } from "react-router-dom";

function HomePage() {
  const navigate = useNavigate();
  const location = useLocation();
  const path = location.pathname;

  console.log(path);

  useEffect(() => {
    if (path === "/") {
      navigate("/signup");
    }
  }, []);

  return;
}

export default HomePage;
